    [Fact]
    internal void GetContractAbi_ExpectedAbi()
    {
        using var httpTest = new HttpTest();
        httpTest.ForCallsTo($"{baseUrl}{nameWithVersion}")
            .RespondWithJson(response);

        var result = ContractAbiManager.GetContractAbi(nameWithVersion);

        Assert.NotNull(result);
        Assert.Equal(response?[0]?["ABI"]?.ToString(), result);
    }

    [Fact]
    internal void GetContractAbi_AbiNotFound_ThrowException()
    {
        using var httpTest = new HttpTest();
        httpTest.ForCallsTo($"{baseUrl}{nameWithVersion}")
            .RespondWith("[]");

        Action testCode = () => ContractAbiManager.GetContractAbi(nameWithVersion);

        var exception = Assert.Throws<Exception>(testCode);
        Assert.Equal("Contract ABI not found for the specified name and version.", exception.Message);
    }
